import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Home from './pages/Home';

const App = () => {
  return (
    <BrowserRouter>
       <switch>
         <Route path='/' exact component = {Home}></Route>
       </switch>
    </BrowserRouter>
  );
};

export default App;
